css:
.markdown-preview {
  max-width: 900px;
  margin: 0 auto;
  padding: 25px;
  color: black;
}
.markdown-preview p.author {
  width: 200px;
  height: 8px;
  margin-left: auto;
  margin-bottom: 0px;
}
.markdown-preview p.author:before {
  content: "作成者：";
}
.markdown-preview p.since {
  width: 200px;
  height: 8px;
  margin-left: auto;
}
.markdown-preview p.since:before {
  content: "作成日：";
}
.markdown-preview hr {
  margin: 50px 0;
  background-color: transparent;
}
.markdown-preview hr:after {
  content: "";
  display: block;
  border-top-style: ridge;
}
.markdown-preview hr.pb {
  page-break-after: always;
}
.markdown-preview hr.pb:after {
  display: none;
}
.markdown-preview h1,
.markdown-preview h2,
.markdown-preview h3,
.markdown-preview h4,
.markdown-preview h5 {
  font-weight: normal;
  border-color: #666666;
}
.markdown-preview h1 {
  font-size: 35px;
  border: none;
  margin: 35px auto;
  text-align: center;
  letter-spacing: 5px;
}
.markdown-preview h2 {
  font-size: 25px;
  letter-spacing: 3px;
  margin: 50px auto 25px;
}
.markdown-preview h2:before {
  content: "";
  background-color: #ffa500;
  width: 5px;
  height: 35px;
  float: left;
  margin-right: 5px;
}
.markdown-preview h3 {
  font-size: 18px;
  font-weight: bold;
  margin-left: 10px;
  margin-bottom: 10px;
}
.markdown-preview p,
.markdown-preview table,
.markdown-preview ul,
.markdown-preview ol,
.markdown-preview dl,
.markdown-preview pre,
.markdown-preview blockquote {
  margin-left: 15px;
}
.markdown-preview p ul,
.markdown-preview table ul,
.markdown-preview ul ul,
.markdown-preview ol ul,
.markdown-preview dl ul,
.markdown-preview pre ul,
.markdown-preview blockquote ul,
.markdown-preview p ol,
.markdown-preview table ol,
.markdown-preview ul ol,
.markdown-preview ol ol,
.markdown-preview dl ol,
.markdown-preview pre ol,
.markdown-preview blockquote ol,
.markdown-preview p dl,
.markdown-preview table dl,
.markdown-preview ul dl,
.markdown-preview ol dl,
.markdown-preview dl dl,
.markdown-preview pre dl,
.markdown-preview blockquote dl {
  margin-left: 0px;
}
.markdown-preview table {
  border-collapse: collapse;
  border-spacing: 0;
  max-width: 800px;
}
.markdown-preview table th {
  text-align: center;
  background-color: #eee;
  border-color: #666666;
}
.markdown-preview table tr {
  border-top: #666;
}
.markdown-preview table td {
  border-color: #666666;
}
.markdown-preview .margin-clear {
  margin-left: 0;
}
.markdown-preview .center {
  text-align: center;
}
.markdown-preview .right {
  text-align: right;
}
.markdown-preview pre.editor-colors {
  background-color: black !important;
}
.markdown-preview pre.editor-colors .line {
  background-color: black;
}
